import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Header from '../components/Header';
import Footer from '../components/Footer';
import Home from './Home';
import About from './About';
import Pricing from './Pricing';
import Gigs from './Gigs';
import Contact from './Contact';

import LoginForma from '../components/Login';
import RegisterForma from '../components/RegisterForma';

import './App.css';
import '../components/loginstil.css';

function App() {
    const [currentUser, setCurrentUser] = useState(null);
    const [showLogin, setShowLogin] = useState(true);

    const handleLogin = (user) => {
        localStorage.setItem('ulogovaniKorisnik', JSON.stringify(user));
        setCurrentUser(user);
    };

    const handleRegister = (user) => {
        localStorage.setItem('ulogovaniKorisnik', JSON.stringify(user));
        setCurrentUser(user);
    };

    const handleLogout = () => {
        localStorage.removeItem('ulogovaniKorisnik');
        setCurrentUser(null);
    };

    return (
        <Router>
            <div className="app-layout">
                <Header />

                <nav>
                    {currentUser ? (
                        <div>
                            <span>Dobrodošli, {currentUser.ime || currentUser.name}!</span>
                            <button onClick={handleLogout}>Odjava</button>
                        </div>
                    ) : (
                        <div className="auth-options">
                            <button
                                onClick={() => setShowLogin(true)}
                                className={showLogin ? 'active' : ''}
                            >
                                Prijava
                            </button>
                            <button
                                onClick={() => setShowLogin(false)}
                                className={!showLogin ? 'active' : ''}
                            >
                                Registracija
                            </button>
                        </div>
                    )}
                </nav>

                <main>
                    {!currentUser ? (
                        showLogin ? (
                            <LoginForma onLogin={handleLogin} />
                        ) : (
                            <RegisterForma onRegister={handleRegister} />
                        )
                    ) : (
                        <Routes>
                            <Route path="/" element={<Home />} />
                            <Route path="/about" element={<About />} />
                            <Route path="/pricing" element={<Pricing />} />
                            <Route path="/gigs" element={<Gigs />} />
                            <Route path="/contact" element={<Contact />} />
                        </Routes>
                    )}
                </main>

                <Footer />
            </div>
        </Router>
    );
}

export default App;
